import React,{Component} from 'react';
//import classes from './PostedAds.module.css'
import PostedAd from  '../PostedAd/PostedAd'
import axios from '../../axios-data'
class PostedAds extends Component{
    componentDidMount(){
        axios.get('/')
    }
    render(){
        return(
            <div>

                <PostedAd/>
                <PostedAd/>
                <PostedAd/>
            </div>
        )
    }

}

export default  PostedAds;
